import BoardComponent from "../BoardComponent";
import CellComponent from "../CellComponent";

function App() {
	return (
		<BoardComponent>
			<CellComponent />
			<CellComponent />
			<CellComponent />
			<CellComponent />
		</BoardComponent>
	);
}

export default App;
